import React from 'react';
import styles from '../App.module.css';


const Navbar: React.FC = () => {
  return (
    <nav className={styles.navbar}>
      <h1 className={styles.navbarTitle}>SFlix</h1>
      <ul className={styles.navList}>
        <li className={styles.navItem}><a href="/" className={styles.navLink}>Anasayfa</a></li>
        <li className={styles.navItem}><a href="/about" className={styles.navLink}>Hakkımızda</a></li>
        <li className={styles.navItem}><a href="/contact" className={styles.navLink}>İletişim</a></li>
      </ul>
    </nav>
  );
};

export default Navbar;
